import React from 'react';
import './App.css';

class Products extends React.Component {

    render() {
        return (
            <div className="App">
                <p style={{ fontSize: '35px' }}>{this.props.name}</p>
                <p>{this.props.price} Dollars</p>
                <p>Amount: {this.props.value}</p>
                <button onClick={this.props.onValueChanged(this.props.name)}>Add to cart</button>
            </div>
        )
    }
}

export default Products;
